injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-161127a856eae",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/rzr/Desktop/学习/rzrVuepress/docs/README.md").then(comp => {
        Vue.component("v-161127a856eae", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-a6ac9e0f1d966",
    path: "/accumulate/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
