        Vue.component("v-a6ac9e0f1d966", comp.default)
        next()
      })
    }
  },
  {
    path: "/accumulate/index.html",
    redirect: "/accumulate/"
  },
  {
    name: "v-6ca737281f20f",
    path: "/algorithm/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/rzr/Desktop/学习/rzrVuepress/docs/algorithm/README.md").then(comp => {
        Vue.component("v-6ca737281f20f", comp.default)
        next()
      })
    }
  },
  {
    path: "/algorithm/index.html",
    redirect: "/algorithm/"
  },
  {
    name: "v-706b18722e02b",
    path: "/guide.html",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("/Users/rzr/Desktop/学习/rzrVuepress/docs/guide.md").then(comp => {
        Vue.component("v-706b18722e02b", comp.default)
        next()
      })
    }
  },
  {
    name: "v-19d291d2d3856",
